import React, { Component } from 'react';
import { Collapse, Container, Dropdown, DropdownItem, DropdownMenu, Navbar, NavbarBrand, NavbarToggler, NavItem, NavLink, DropdownToggle } from 'reactstrap';
import { Link } from 'react-router-dom';
import './../resources/css/NavMenu.css';

export class NavMenu extends Component {
  static displayName = NavMenu.name;

  constructor (props) {
    super(props);

    this.toggleNavbar = this.toggleNavbar.bind(this);
    this.state = {
      collapsed: true
    };
  }

  toggleNavbar () {
    this.setState({
      collapsed: !this.state.collapsed
    });
  }

  render () {
      return (
          <header>
              <Navbar className="navbar-expand-sm navbar-toggleable-sm ng-white border-bottom box-shadow mb-3" light>
                  <Container>
                      <NavbarBrand tag={Link} to="/">Avanade Digital Academy</NavbarBrand>
                      <NavbarToggler onClick={this.toggleNavbar} className="mr-2" />
                      <Collapse className="d-sm-inline-flex flex-sm-row-reverse" isOpen={!this.state.collapsed} navbar>
                          <ul className="navbar-nav flex-grow">
                              <NavItem>
                                  <NavLink tag={Link} className="text-dark" to="/Samples">Samples</NavLink>
                              </NavItem>

                              <NavItem>
                                  <NavLink tag={Link} className="text-dark" to="/day2">Day 2</NavLink>
                              </NavItem>

                                <Dropdown nav toggle={function noRefCheck() { }}>
                                <DropdownToggle caret nav>
                                          Dropdown
                              </DropdownToggle>

                                <DropdownMenu>
                                          Day 1 ex
                              </DropdownMenu>

                                      <DropdownItem>
                                          ]abc
                                      </DropdownItem>
                                      <DropdownItem>
                                          ]ddd
                                      </DropdownItem>
                                  </Dropdown>
                          </ul>
                      </Collapse>
                  </Container>
              </Navbar>
          </header>
      );
  }
}



<Dropdown
    nav
    toggle={function noRefCheck() { }}
>
    <DropdownToggle
        caret
        nav
    >
        Dropdown
    </DropdownToggle>
    <DropdownMenu>
        <DropdownItem header>
            Header
        </DropdownItem>
        <DropdownItem disabled>
            Action
        </DropdownItem>
        <DropdownItem>
            Another Action
        </DropdownItem>
        <DropdownItem divider />
        <DropdownItem>
            Another Action
        </DropdownItem>
    </DropdownMenu>
</Dropdown>
